  false,\n\t\"url\": null,\n\t\"notes\": \"Report on a study of bird use and nest
  success in Conservation Reserve Program (CRP) fields.  This study aims to find that
  reproductive success in CRP fields is at least as high as success in Waterfowl Production
  Areas (WPA), to indicate that CRP fields provide at least as safe nesting cover.
  \ This study measures nest success as an index of reproductive success, and bird
  use of cropland in 1992, and the difference between CRP fields and WPA fields. .
  \ This report summarizes some of the data collected in 1991 and 1992 from this ongoing
  study.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
